import Navbar from "./../components/navbar/navbar";
import ListTask from "./../components/ListTask/listTask";
import styled from "styled-components";

const InSTyle = styled.div`
  width: 100%;
  height: 100vh;
  display: flex;
  flex-direction: row;
`;

export default function Index() {
  return (
    <InSTyle>
      <Navbar />
      <ListTask />
    </InSTyle>
  );
}
